CREATE TABLE IF NOT EXISTS redir (
	src TEXT NOT NULL PRIMARY KEY,       -- source url path
	dst TEXT,                            -- destination url path
	type TEXT,                           -- category of redir
	status INTEGER DEFAULT 301 NOT NULL  -- http status code
);

